INSERT INTO `tb_penyakit` (`id_penyakit`, `nama_penyakit`, `det_penyakit`, `srn_penyakit`, `tipe_penyakit`, `gambar_penyakit`) VALUES
(22, 'Katarak Kongenital', '<p>Katarak kongenital merupakan katarak yang dialami bayi baru lahir yang lensa matanya mengalami keruh atau buram sejak lahir. Sinar cahaya yang masuk ke mata menjadi tersebar ketika melewati lensa yang keruh, sehingga gambar dan cahaya yang masuk ke dalam mata menjadi kabur dan tidak sempurna</p>\r\n', '<p>Segera lakukan konsultasi ke dokter mata, jika penyakit yang terjadi cukup parah maka dokter akan melakukan penanganan seperti operasi mata</p>\r\n', '5 Tahun Kebawah', 'kongenital.jpg'),
(23, 'Katarak juvenil', '<p>Katarak juvenil merupakan katarak lembek yang terdapat pada orang muda dan mulai terbentuknya pada usia 3 bulan sampai 9 tahun. Katarak juvenil diakibatkan oleh gangguan pada perkembangan normal lensa. Katarak jenis ini sering dapat dijumpai pada anak/remaja sehingga anak-anak sering mengalami penurunan produktivitas</p>\r\n', '<p>Segera melakukan konsultasi dengan dokter agar dilakukan operasi mata secepatnya. jika lama dibiarkan dapat mengganggu perkembangan mata seperti mata malas (ambliopia) bahkan kebutaan</p>\r\n', '5 Tahun Kebawah', 'juvenil.jpg'),
(24, 'Katarak insipien', '<p>Merupakan stadium satu (awal), dimana kekeruhan lensa mata masih sangat minim, bahkan terkadang sulit terlihat tanpa menggunakan alat bantu periksa. Pada tahap ini seringkali penderitanya tidak merasakan keluhan atau gangguan pada penglihatannya, sehingga cenderung diabaikan. Kekeruhan mulai dari tepi ekuator berbentuk jeruji menuju korteks anterior dan posterior</p>\r\n', '<p>Segera lakukan pemeriksaan lebih lanjut di dokter mata agar dokter dapat memberikan obat mata yang sesuai dengan dosis yang diperlukan</p>\r\n', '5 Tahun Keatas', 'insipien.png'),
(25, 'Katarak senilis imatur', '<p>Merupakan katarak stadium dua yang ditandai dengan kekeruhan lensa mata yang lebih tebal tetapi belum mengenai seluruh lensa sehingga masih terdapat bagian- bagian yang jernih pada lensa. Pada stadium ini terjadi hidrasi kortek yang mengakibatkan lensa menjadi bertambah cembung. Pencembungan lensa akan memberikan perubahan indeks refraksi dimana mata akan menjadi mioptik. Kecembungan ini akan mengakibatkan pendorongan iris kedepan sehingga bilik mata depan akan lebih sempit</p>\r\n', '<p>Segera lakukan pemeriksaan lab di dokter mata untuk diberikan obat mata&nbsp;</p>\r\n', '5 Tahun Keatas', 'senilis imatur.jpeg'),
(26, 'Katarak senilis matur', '<p>Katarak senilis matur merupakan katarak stadium tiga (tahap lanjut), dimana kekeruhan telah mengenai seluruh massa lensa. Kekeruhan ini terjadi akibat deposit ion Ca yang menyeluruh. Apabila dibiarkan saja akan menjadi katarak dengan kandungan air berlebih, yang dapat memblok pupil dan menyebabkan tekanan pada bola mata meningkat</p>\r\n', '<p>Disarankan untuk melakukan operasi dan penggantian lensa mata</p>\r\n', '5 Tahun Keatas', 'senilis matur.jpg'),
(27, 'Katarak senilis hipermatur', '<p>Katarak senilis hipermatur merupakan stadium empat (tahap sangat lanjut), dimana kekeruhan telah mengenai seluruh massa lensa dan telah mengalami proses degenerasi lanjut, dapat menjadi lembek dan mencair. Masa lensa telah mencair dan sudah merembes melalui kapsul lensa dan bisa menyebabkan peradangan pada struktur mata yang lainya. Pada tahap ini penglihatan sudah sangat menghilang dan sudah masuk ke fase glaukoma atau kebutaan</p>\r\n', '<p>Segera menghubungi dokter untuk dilakukan operasi ganti lensa mata</p>\r\n', '5 Tahun Keatas', 'senilis hipermatur.jpeg'),
(28, 'Katarak traumatik', '<p>Katarak traumatik merupakan kondisi ketika lensa mata menjadi keruh akibat luka atau cedera pada mata. Kondisi ini dapat terjadi secara singkat atau bertahun-tahun setelah mata mengalami cedera</p>\r\n', '<p>Disarankan segera melakukan operasi mata dan penggantian lensa mata</p>\r\n', 'Umum', 'traumatik.jpeg');
